	private void setCustomer() {
		if (arg != null)
			customer = (Customer) arg.get("customer");
	}

	public void refreshCustomer(Customer customer) {
		if (isColored) {
			isColored = false;
			removeColoring(main);
		}

		setCustomer(customer);
		initDependentComboboxes();
		binder.loadAll();
	}

	public void loadAll() {
		binder.loadAll();
	}

