	public void onClick$openSearchWnd() {
		searchGrid.setVisible(true);
		openSearchGrid.setVisible(false);
	}

	public void onClick$closeSearchWnd() {
		searchGrid.setVisible(false);
		openSearchGrid.setVisible(true);
	}

	public void onCheck$radioGroup() {
		rowsVisibleFalse();
		if (radioGroup.getSelectedItem().getValue().equals("1")) {
			pinfl_row.setVisible(true);
			// passport_row.setVisible(true);
			birth_date_row.setVisible(true);
		} else if (radioGroup.getSelectedItem().getValue().equals("2")) {
			pinfl_row.setVisible(true);
			passport_row.setVisible(true);
			// doc_date_row.setVisible(true);
			birth_date_row.setVisible(true);
		} else if (radioGroup.getSelectedItem().getValue().equals("3")) {
			pinfl_row.setVisible(true);
			passport_row.setVisible(true);
			birth_date_row.setVisible(true);
		} else if (radioGroup.getSelectedItem().getValue().equals("4")) {
			inn_row.setVisible(true);
		} else if (radioGroup.getSelectedItem().getValue().equals("5")) {
			pinfl_row.setVisible(true);
			doc_date_row.setVisible(true);
		} else if (radioGroup.getSelectedItem().getValue().equals("6")) {
			passport_row.setVisible(true);
			birth_date_row.setVisible(true);
		}
	}

	private void rowsVisibleFalse() {
		passport_row.setVisible(false);
		inn_row.setVisible(false);
		pinfl_row.setVisible(false);
		birth_date_row.setVisible(false);
		doc_date_row.setVisible(false);
	}

	public void onClick$fill_client_form_btn() {
		// logger.error("not err start ");

		try {
			String number = pasport_num.getValue();
			String seria = pasport_ser.getValue();
			String pin = pinfl.getValue();
			String inn_ = inn.getValue();
			Date pbirthday = null;
			try {
				pbirthday = birth_date.getValue();
			} catch (WrongValueException e) {
				pbirthday = null;
			}

			StringBuilder url = new StringBuilder(ConnectionPool.getValue("GetPhysicalServiceUrl") + "?");
			String branch = (String) session.getAttribute("branch");
			url.append("bank=" + CustomerUtils.getBankType(branch) + "");
			url.append("&lang=3");
			url.append("&branch=" + branch);

			if (radioGroup.getSelectedItem().getValue().equals("1")) {
				url.append("&pin=" + pin);
				DateTime birthdate = null;
				if (pbirthday != null) {
					birthdate = new DateTime(pbirthday);
					url.append("&date_birth=" + CustomerUtils.dateTimeToString(birthdate));
				}
			} else if (radioGroup.getSelectedItem().getValue().equals("2")) {
				url.append("&pin=" + pin);
				url.append("&passport_seria=" + seria);
				url.append("&passport_number=" + number);
			} else if (radioGroup.getSelectedItem().getValue().equals("3")) {
				url.append("&passport_seria=" + seria);
				url.append("&passport_number=" + number);
			} else if (radioGroup.getSelectedItem().getValue().equals("4")) {
				url.append("&inn=" + inn_);
			} else if (radioGroup.getSelectedItem().getValue().equals("5")) {
				url.append("&pin=" + pin);
			} else if (radioGroup.getSelectedItem().getValue().equals("6")) {
				url.append("&passport_seria=" + seria);
				url.append("&passport_number=" + number);
				DateTime birthdate = null;
				if (pbirthday != null) {
					birthdate = new DateTime(pbirthday);
					url.append("&date_birth=" + CustomerUtils.dateTimeToString(birthdate));
				}
			}

			if (check_agreement.isChecked()) {
				url.append("&agreement=1");
			} else {
				url.append("&agreement=0");
			}

			Long id = CustomerUtils.getNextId();
			url.append("&id=" + id);
			logger.error("not err url: " + url.toString());
			System.out.println("url: " + url.toString());

			try {
				logger.error("not err sendUrlRequest start ");
				sendUrlRequest(url.toString());
				logger.error("not err sendUrlRequest end ");

				PhysicalAutoCompleteModel customerComplete = CustomerUtils.getCustomerModel(id);
				if (customerComplete != null) {

					logger.error("not err " + "customerComplete.getLast_name() = " + customerComplete.getLast_name());

					customer.setP_family_local(customerComplete.getLast_name());
					customer.setP_first_name_local(customerComplete.getFirst_name());
					customer.setP_patronymic_local(customerComplete.getPatronym());
					customer.setP_family(customerComplete.getSurname());
					customer.setP_first_name(customerComplete.getGivenname());
					if (customerComplete.getGive_place() != null && customerComplete.getGive_place().length() == 5) {
						PhysicalAutoCompleteModel temp = CustomerUtils.getSomeData(customerComplete.getGive_place());
						if (temp != null) {
							customer.setP_pass_place_region(temp.getTemp_region());
							if (temp.getTemp_district() != null)
								code_distr_pasp = temp.getTemp_district();
							customer.setP_pass_place_district(temp.getTemp_district());
							customer.setP_passport_place_registration(
									CustomerUtils.toTranslitNew(temp.getGive_place()) + " IIB");
							if (temp.getInn_registrated_gni() != null)
								customer.setP_code_tax_org(temp.getInn_registrated_gni());
						}
					}
					customer.setP_passport_serial(customerComplete.getPassport_seria());
					customer.setP_passport_number(customerComplete.getPassport_number());
					customer.setP_passport_date_registration(customerComplete.getDate_issue());
					customer.setP_passport_date_expiration(customerComplete.getDate_expiry());

					if (customerComplete.getNationality() != null) {
						for (int i = 0; i < nationMapList.size(); i++) {
							if ((nationMapList.get(i)).getData().equals(customerComplete.getNationality())
									|| (nationMapList.get(i)).getData() == customerComplete.getNationality()) {
								customer.setP_code_nation(nationMapList.get(i).getLabel());
								break;
							}
						}
					}

					customer.setP_code_gender(
							customerComplete.getSex() != null ? customerComplete.getSex() + "" : null);
					customer.setP_birthday(customerComplete.getBirth_date());
					if (customerComplete.getBirth_place() != null)
						customer.setP_birth_place(CustomerUtils.toTranslitNew(customerComplete.getBirth_place()));
					customer.setP_code_adr_region(customerComplete.getDomicile_region());
					initModelsForListbox();
					if (customerComplete.getDomicile_district() != null)
						code_distr_adr = customerComplete.getDomicile_district();

					customer.setP_code_adr_distr(customerComplete.getDomicile_district());
					String place_desc = customerComplete.getDomicile_place_desc() == null ? ""
							: customerComplete.getDomicile_place_desc();
					String street_desc = customerComplete.getDomicile_street_desc() == null ? ""
							: customerComplete.getDomicile_street_desc();
					String address = customerComplete.getDomicile_address() == null ? ""
							: customerComplete.getDomicile_address();
					address += customerComplete.getDomicile_house() == null ? ""
							: ", " + customerComplete.getDomicile_house();
					address += customerComplete.getDomicile_flat() == null ? ""
							: ", " + customerComplete.getDomicile_flat();

					customer.setP_post_address(
							CustomerUtils.toTranslitNew(place_desc + " " + street_desc + " " + address));
					customer.setP_number_tax_registration(customerComplete.getInn());

					customer.setP_inps(customerComplete.getPin());
					customer.setP_pinfl(customerComplete.getPin());
					binder.loadAll();
				}
			} catch (Exception e) {
				e.printStackTrace();
				ISLogger.getLogger().error(CheckNull.getPstr(e));
			}

			// } else alert("Серия или номер паспорта не заполнены");
		} catch (WrongValueException e) {
			alert("Серия или номер паспорта не заполнены(WrongValueException)");
			e.printStackTrace();
		}
	}

	public void onClick$fill_FizAddress_btn() throws Exception {

		// logger.error("not err start ");
		String pin = pinfl.getValue();
		// String number = pasport_num.getValue();
		// String seria = pasport_ser.getValue();

		// adres
		FizAddressResponse far = TheService.fizAddressResponse(sessionAttributes.getBranch(), pin, ""+sessionAttributes.getUid());

		customer.setCode_country(far.getDataObject().getPermanentRegistration().getCountry().getId());
		customer.setP_code_adr_region(far.getDataObject().getPermanentRegistration().getRegion().getId());
		initModelsForListbox();
		customer.setP_code_adr_distr(far.getDataObject().getPermanentRegistration().getDistrict().getId());
		customer.setP_post_address(far.getDataObject().getPermanentRegistration().getAddress());

		binder.loadAll();
		alert("ok!");
	}

	public void onClick$fill_FizInfoDetails_btn() throws Exception {

		// logger.error("not err start ");
		String pin = pinfl.getValue();
		String number = pasport_num.getValue();
		String seria = pasport_ser.getValue();

		// details
		FizInfoDetailsResponse fizInfo = TheService.fizInfoDetailsResponse(sessionAttributes.getBranch(), pin, seria, number, ""+sessionAttributes.getUid());
		customer.setP_family_local(fizInfo.getData().getPersonaldata().getRow().getSurnamelatin());
		customer.setP_first_name_local(fizInfo.getData().getPersonaldata().getRow().getNamelatin());
		customer.setP_pinfl("" + fizInfo.getData().getPersonaldata().getRow().getPinpp());
		customer.setP_birthday(df.parse(fizInfo.getData().getPersonaldata().getRow().getBirth_date()));
		// }
		binder.loadAll();
		alert("ok!");
	}

