	@SuppressWarnings("deprecation")
	private static void sendUrlRequest(String urlString) throws Exception {

		HttpClient client = HttpClientBuilder.create().build();
		HttpGet request = new HttpGet(urlString);
		ISLogger.getLogger().error("not err client.execute(request)");
		System.out.println("not err client.execute(request) ");

		HttpResponse response = client.execute(request);
		System.out.println("Response Code : " + response.getStatusLine().getStatusCode());
		ISLogger.getLogger().error("not err Response Code : " + response.getStatusLine().getStatusCode());
		System.out.println(EntityUtils.toString(response.getEntity(), "UTF-8"));
	}

	public void showDifferences() throws InterruptedException {
		sourceDataWnd.setVisible(true);
		Rows rows = sourceDataWnd$sourceDataGrid.getRows();
		rows.getChildren().clear();

		Customer customer_ = getCustomerFromSAP();
		Properties properties = getProperties();

		for (Field field : Customer.class.getDeclaredFields()) {
			field.setAccessible(true);

			String fieldName = field.getName();

			boolean exclude = DiffUtils.exclude(fieldName);
			if (exclude)
				continue;

			String fieldLabel = properties.getProperty("client_p." + fieldName);

			if (fieldLabel != null) {
				try {
					Object obj1 = field.get(customer);
					Object obj2 = field.get(customer_);
					if (obj1 instanceof String && ((String) obj1).isEmpty())
						obj1 = null;
					if (obj2 instanceof String && ((String) obj2).isEmpty())
						obj2 = null;

					if (DiffUtils.hasChanges(obj1, obj2)) {
						Row row = new Row();
						Label label = new Label(fieldLabel);

						InputElement source = null;
						InputElement sap = null;

						if (obj1 instanceof java.util.Date || obj2 instanceof java.util.Date) {
							source = new Datebox((java.util.Date) obj1);
							sap = new Datebox((java.util.Date) obj2);
						} else {
							source = new Textbox(obj1 == null ? "" : obj1.toString());
							sap = new Textbox(obj2 == null ? "" : obj2.toString());
							source.setHflex("1");
							sap.setHflex("1");
						}

						Checkbox checkbox = new Checkbox();
						checkbox.setId("check_" + fieldName);
						source.setReadonly(true);
						sap.setReadonly(true);

						row.appendChild(label);
						row.appendChild(source);
						row.appendChild(sap);
						row.appendChild(checkbox);
						rows.appendChild(row);
					}
				} catch (Exception e) {
					logger.error(CheckNull.getPstr(e));
				}
			}
		}
	}

	private boolean hasChildren(Rows rows) {
		if (rows.getChildren() != null)
			if (rows.getChildren().size() > 0)
				return true;
		return false;
	}

	public Customer getCustomerFromSAP() throws InterruptedException {
		try {
			return SAPServiceFactory.getInstance().getBusinessPartnerService().get(null, null, customer.getIdSap());
		} catch (Exception e) {
			logger.error(CheckNull.getPstr(e));
			Messagebox.show(e.getMessage());
		}
		throw new IllegalStateException("Customer From SAP CRM is Null");
	}

