	public void onClick$btnSave$sourceDataWnd() throws InterruptedException {
		isColored = true;
		sourceDataWnd.setVisible(false);

		String style = "color:blue";
		try {
			List<Checkbox> selectedCheckboxes = getSelectedCheckboxes();
			for (Checkbox checkbox : selectedCheckboxes) {
				String fieldName = checkbox.getId().split("check_")[1];

				InputElement component = (InputElement) main.getFellow(fieldName);

				component.setStyle(style);

				Field field = Customer.class.getDeclaredField(fieldName);
				field.setAccessible(true);

				Object value = null;
				Component valueComp = checkbox.getPreviousSibling();

				if (valueComp instanceof Textbox)
					value = ((Textbox) valueComp).getValue();
				if (valueComp instanceof Datebox)
					value = ((Datebox) valueComp).getValue();

				field.set(customer, value);
			}
		} catch (Exception e) {
			org.zkoss.zul.Messagebox.show(CheckNull.getPstr(e));
		}
		initDependentComboboxes();
		binder.loadAll();
	}

	private void removeColoring(Component component) {
		if (component.getChildren().size() == 0)
			if (component instanceof InputElement)
				((InputElement) component).setStyle(null);

		List<Component> list = component.getChildren();
		for (Component child : list)
			removeColoring(child);
	}

	private List<Checkbox> getSelectedCheckboxes() {
		List<Checkbox> list = new ArrayList<Checkbox>();
		List<Row> rows = sourceDataWnd$sourceDataGrid.getRows().getChildren();
		for (Row row : rows) {
			Checkbox checkBox = (Checkbox) row.getLastChild();
			if (checkBox.isChecked()) {
				list.add(checkBox);
			}
		}
		return list;
	}

	public void onClick$selectAllCheckbox$sourceDataWnd() {
		Rows rows = sourceDataWnd$sourceDataGrid.getRows();
		List<Row> list = rows.getChildren();

		for (Row row : list) {
			List<Component> children = row.getChildren();
			for (Component child : children) {
				if (child instanceof Checkbox) {
					if (sourceDataWnd$selectAllCheckbox.isChecked())
						((Checkbox) child).setChecked(true);
					else
						((Checkbox) child).setChecked(false);
				}
			}
		}
	}

